import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useParams } from 'react-router-dom'
import { fetchMedicalHistory } from '../actions/userAction'
import { Row, Col, ListGroup, Card } from 'react-bootstrap'
import Loader from '../components/Loader'
import Message from '../components/Message'

const Medicalhistory = () => {
  const { id } = useParams()
  const dispatch = useDispatch()
  const medicalHistoryState = useSelector(state => state.userMedical)
  const { medicalHistories, loading, error } = medicalHistoryState

  useEffect(() => {
    if (id) {
      dispatch(fetchMedicalHistory(id))
    }
  }, [dispatch, id])

  return (
    <>
      {loading ? (
        <Loader />
      ) : error ? (
        <Message variant='danger'>{error}</Message>
      ) : (
        <Row>
          {medicalHistories.map(history => (
            <Col md={6} key={history._id}>
              <Card className="mb-3">
                <ListGroup variant='flush'>
                  <ListGroup.Item>
                    <h4>Medical ID: {history._id}</h4>
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>User:</strong> {history.user.name}
                    <br />
                    <strong>Birth Day:</strong> {history.user.dateOfBirth}
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Staff:</strong> {history.staff}
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Test:</strong> {history.test}
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Medical Prescription:</strong> {history.medicalPrescription}
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Diagnostic Result:</strong> {history.diagnosticResult}
                  </ListGroup.Item>
                  <ListGroup.Item>
                    <strong>Date:</strong> {history.date}
                  </ListGroup.Item>
                </ListGroup>
              </Card>
            </Col>
          ))}
        </Row>
      )}
    </>
  )
}

export default Medicalhistory
